#!/usr/bin/env pythonimport sysmyList = []n = 5	# Number of top N recordsfor line in sys.stdin:	# remove leading and trailing whitespace	line = line.strip()		# split data values into list	data = line.split(",")	# convert attributes (currently a string) to int	try:		number = float(data[4])		temp = float(data[9])	except ValueError:		# ignore/discard this line		continue		if temp > 25.0:                # add (state, number) touple to list                myList.append( (number, line) )	# sort list in reverse order	myList.sort(reverse=True)	# keep only first N records	if len(myList) > n:		myList = myList[:n]# Print top N recordsfor (k,v) in myList:        print("%s\t%s" % (k,v))